export function Login ({user}) {
    return (
    <div className="bg-slate-500 h-screen flex items-center justify-center">
        <div className="border rounded border-white w-1/4 h-2/4 bg-slate-400">
            <div className="text-center"> 
            <h1 className="mt-12 mb-12 text-xl">Login</h1>
            <h2 className="mb-12">Username</h2>
            <input type="text" />
            </div>
        </div>
    </div>
    )
}
